import React, { useState, useEffect } from 'react';
import Card from './Components/Card';
import { images } from './import';	
import './App.css';

function App() {

	const [cards, setCards] = useState([]);

	useEffect(() => {		
		setCards(images);
	}, [])

	return (
		<div className='app'>
			<div className='cards-container'>
				<>
				{
					cards.map((card, i) => (
						<Card />
					))	
				}
				</>				
			</div>
		</div>		
	)
	
}

export default App;
